  _push(`</li></ul></nav><p>OCR4all ist eine Software, die zur digitalen Texterschließung vornehmlich sehr früh gedruckter Werke entwickelt wurde. Da deren Drucktypen und oft komplex gestalteten Layoutkonzeptionen die Erkennungsmöglichkeiten vieler anderer Texterkennungsprogramme übersteigen, bedarf es hier der Möglichkeit, den Digitalisierungsvorgang variabel, korpus- und werkspezifisch zu gestalten. Verständlich und selbstständig anwendbar spricht der in OCR4all vorgeschlagene semi-automatische OCR-Workflow dabei auch einen dezidiert nicht-informatischen Nutzerkreis an und kombiniert unterschiedliche Arbeitswerkzeuge und Tools innerhalb einer einheitlichen Benutzeroberfläche. Der ständige Wechsel zwischen unterschiedlichen Programmen ist deshalb nicht mehr notwendig. Mit dem <a href="http://kallimachos.de/kallimachos/index.php/Kallimachos_II_(Eingehende_Darstellung)#AP1:_OCR-Optimierung" target="_blank" rel="noopener noreferrer">Abschluss`)
  _push((0,server_renderer_.ssrRenderComponent)(_component_OutboundLink, null, null, _parent))
  _push(`</a> der zweiten Projektphase des BMBF-geförderten Verbundprojekts <a href="http://kallimachos.de" target="_blank" rel="noopener noreferrer">Kallimachos`)
  _push((0,server_renderer_.ssrRenderComponent)(_component_OutboundLink, null, null, _parent))
  _push(`</a> wird die Software nun am <a href="https://www.uni-wuerzburg.de/zpd" target="_blank" rel="noopener noreferrer">Zentrum für Philologie und Digitalität`)
  _push((0,server_renderer_.ssrRenderComponent)(_component_OutboundLink, null, null, _parent))
  _push(`</a> der Universität etabliert, um sie einer möglichst breiten Nutzergruppe dauerhaft frei verfügbar zu machen.</p><h3 id="workflow" tabindex="-1"><a class="header-anchor" href="#workflow" aria-hidden="true">#</a> Workflow</h3><p>Von der Vorverarbeitung der zur bearbeitenden Bilddateien (sog. Preprocessing) über die Layoutsegmentierung (sog. Region Segmentation mit <a href="https://github.com/OCR4all/LAREX" target="_blank" rel="noopener noreferrer">https://github.com/OCR4all/LAREX`)
  _push((0,server_renderer_.ssrRenderComponent)(_component_OutboundLink, null, null, _parent))
  _push(`</a>), die Zeilensegmentierung (Line Segmentation) und Texterkennung (Recognition mit <a href="https://github.com/Calamari-OCR" target="_blank" rel="noopener noreferrer">https://github.com/Calamari-OCR`)
  _push((0,server_renderer_.ssrRenderComponent)(_component_OutboundLink, null, null, _parent))
  _push(`</a> ) bis hin zur Korrektur der erkannten Texte (Ground Truth Production) und der Erstellung werkspezifischer OCR-Modelle in einem Trainingsmodul beschreibt OCR4all einen vollwertigen OCR-Workflow.</p><p>Vor allem durch die Möglichkeit der Herstellung und des Trainings werkspezifischer Texterkennungsmodelle können mit OCR4all bei so gut wie allen gedruckten Texten sehr gute Ergebnisse in der digitalen Texterschließung erzielt werden.</p><h3 id="kooperation-mit-ocr-d" tabindex="-1"><a class="header-anchor" href="#kooperation-mit-ocr-d" aria-hidden="true">#</a> Kooperation mit OCR-D</h3><p>Im Sommer 2020 wurde eine Kooperation zwischen OCR4all und der koordinierten Förderinitiative zur Weiterentwicklung von Verfahren der Optical Character Recognition – <a href="https://ocr-d.de" target="_blank" rel="noopener noreferrer">https://ocr-d.de`)
  _push((0,server_renderer_.ssrRenderComponent)(_component_OutboundLink, null, null, _parent))
  _push(`</a> vereinbart. Das Hauptziel des DFG-geförderten OCR-D Projekts ist die konzeptionelle und technische Vorbereitung der Volltexttransformation der im deutschen Sprachraum erschienenen Drucke des 16.-18. Jahrhunderts (VD16, VD17, VD18). Dazu wird die automatischen Volltexterkennung, analog zum OCR4all Ansatz, in einzelne Prozessschritte zerlegt, die in der Open Source OCR-D-Software nachvollzogen werden können, mit dem Ziel, optimale Workflows für die zu prozessierenden alten Drucke zu erstellen und damit wissenschaftlich verwertbare Volltexte zu generieren.</p><p>Gegenstand der Kooperation ist, neben dem fortlaufenden Austausch vor allem über Schnittstellen, skalierbare Softwareimplementierungen, Erstellung und Bereitstellung von GT sowie kommende Entwicklungen im OCR-Bereich, eine technische Annäherung der beiden Projekte. OCR4all wird dazu in seiner OCR-Lösung die OCR-D Spezifikationen umsetzen und Schnittstellen zu OCR-D Werkzeugen realisieren. Setzt OCR4all intern auf OCR-D Lösungen, profitieren OCR4all Anwender:innen von der erweiterten Auswahl an Werkzeugen und den damit einhergehenden Möglichkeiten, wohingegen OCR-D eine größere Reichweite erhält und durch den vereinfachten Zugang auch neue Anwendergruppen in- und außerhalb der VD-Massendigitalisierung erreicht.</p><h3 id="berichterstattung-auswahl" tabindex="-1"><a class="header-anchor" href="#berichterstattung-auswahl" aria-hidden="true">#</a> Berichterstattung (Auswahl)</h3><ul><li>Radiointerview SWR2 Impuls: Mittelalterliche Handschriften werden Textdokumente</li><li><a href="https://fortext.net/tools/tools/ocr4all" target="_blank" rel="noopener noreferrer">Toolvorstellung`)
